import React from "react";
import "./Navbar.css";
class Navbar extends React.Component {
  state = {};
  render() {
    return (
      <div>
        <nav>
          <a href="#">
            <h1>First</h1>
            <h1>Second</h1>
          </a>
        </nav>
      </div>
    );
  }
}

export default Navbar;
